import React from "react";
import { useDispatch, useSelector } from "react-redux";

const FilterOrigin = () => {
    // Redux 
    const store = useSelector(state => state.productsSlice)
    var origins = [];
    store.products.forEach(product => !origins.includes(product.origin) 
                ? origins.push(product.origin) 
                : null)

    return (
        <div className="selectOrigin">
            {
                origins.map(product => 
                    <div className="originList">
                        <input type="checkbox">{product.origin}</input>
                    </div>    
                )
            }
        </div>
    )
}

export default FilterOrigin
